import React, { Component } from "react";

class About extends Component {

  render() {
    return (
      <div>
        <h2>ABOUT</h2>
        <p>I am a designer and developer.</p>
        <p>My Skillset: </p>
        <div>
          <ul class="skills">
          <ExperienceBar percentage = {HMTL_percentage.percentage} />
          <li>HTML                  {HMTL_percentage.text}</li> 
            
          <ExperienceBar percentage = {CSS_percentage.percentage} text = {CSS_percentage.text} />
          <li>CSS</li>
          
          <ExperienceBar percentage = {JS_percentage.percentage} text = {JS_percentage.text} />
          <li>Javascript</li>
          
          <li>ReactJS</li>
          <li>Python</li>
          <li>Java</li>
          <li>C#</li>
          </ul>
        </div>
      </div>
    );
  }
}

const HMTL_percentage = {
  percentage: 50,
  text: "Experienced"
}
const CSS_percentage = {
  percentage: 50,
  text: "Experienced"
}
const JS_percentage = {
  percentage: 50,
  text: "Experienced"
}


function ExperienceBar(props) {
    return (
        <div className="experience-bar">
        <Progress percentage = {props.percentage} />
        <div className="text"> {props.text} </div>
        </div>

    )
}

function Progress(props) {
    return (
        <div className="progress" style={{ width: `${props.percentage}%`}} />
    )
}

export default About;
